Ο Τζόουνς, αναφερόμενος στον Σερ Γουίλιαμ Τζόνσον, σχολίασε, Ήταν αγαπητός, τρυφερός και σχεδόν λατρευόταν από τους Ινδιάνους. Δικαιούμαστε να πούμε ότι "Οι Ινδιάνοι αντιπαθούσαν τον σερ William Johnson."; Ναι, όχι, ή ίσως;
Οχι

Την περασμένη Κυριακή, 18 Ιουνίου, η βροχή έφτασε και περιορίστηκε αυστηρά στο φετινό φεστιβάλ Keepers of the Lore/Joseph Campbell, Φεστιβάλ για τους Μύθους, την Λαογραφία και την Ιστορία. Δικαιούμαστε να πούμε ότι "Έβρεξε την προηγούμενη Κυριακή."; Ναι, όχι, ή ίσως;
Ναί

Η αστυνομία ανακοίνωσε ότι απέκλεισε τον ετεροθαλή αδελφό και την ετεροθαλή αδελφή του JonBenet Ramsey ως υπόπτους στη δολοφονία της, προφανώς επειδή και οι δύο ήταν εκτός πόλης όταν διαπράχθηκε το έγκλημα. Δικαιούμαστε να πούμε ότι "Ο ετεροθαλής αδελφός του Jon Benet Ramsey δεν ήταν στην πόλη όταν είχε συμβεί η δολοφονία."; Ναι, όχι, ή ίσως;
Ναί

Λοιπόν, δεν το σκέφτηκα καν, αλλά ήμουν τόσο απογοητευμένος, και κατέληξα να του μιλάω και πάλι. Δικαιούμαστε να πούμε ότι "Δεν του μίλησα ξανά."; Ναι, όχι, ή ίσως;
